CREATE DEFINER=`test`@`%` PROCEDURE `remove_gramata`(IN `isbn` CHAR(20) CHARSET utf8)
    READS SQL DATA
BEGIN

DELETE FROM Gramata WHERE Gramata.ISBN=isbn;

