CREATE DEFINER=`test`@`%` PROCEDURE `update_gramata`(IN `gr_isbn` CHAR(20) CHARSET utf8, IN `gr_nosaukums` VARCHAR(45), IN `gr_apraksts` TEXT, IN `gr_id_autors` INT, IN `gr_id_izdevnieciba` INT, IN `gr_zanrs` VARCHAR(45), IN `gr_valoda` VARCHAR(45) CHARSET utf8, IN `gr_lpp` VARCHAR(45), IN `gr_bilde` BLOB, IN `gr_gads` CHAR(4), IN `gr_vaka_tips` VARCHAR(45), IN `gr_cena` DECIMAL(6,2), IN `gr_daudzums` INT)
    READS SQL DATA
BEGIN 
UPDATE Gramata SET Nosaukums = gr_nosaukums, Apraksts = gr_apraksts,
ID_Autors=gr_id_autors,
Zanrs=gr_zanrs,
Valoda=gr_valoda,
Lpp=gr_lpp,
Bilde=gr_bilde,
Gads=gr_gads,
Vaka_tips=gr_vaka_tips,
Cena=gr_cena,
Skaits=gr_daudzums
WHERE ISBN = gr_isbn;

UPDATE Izdevnieciba_Gramata SET ID_Izdevnieciba = gr_id_izdevnieciba WHERE ISBN = gr_isbn;

END$$

--
