CREATE DEFINER=`test`@`%` FUNCTION `getDaudzums`(`isbn` CHAR(20) CHARSET utf8) RETURNS int(11)
    READS SQL DATA
BEGIN
DECLARE sk INT;
SELECT Skaits INTO sk FROM Gramata gr WHERE gr.ISBN=isbn;
RETURN sk;

END$$

CREATE DEFINER=`test`@`%` FUNCTION `rating`(`isbn` VARCHAR(45) CHARSET utf8) RETURNS decimal(3,2)
    READS SQL DATA
BEGIN
DECLARE rate DECIMAL(3,2);
SELECT 
    ROUND((SUM(vrt.Vertejums) / COUNT(vrt.Vertejums)),2) INTO rate 
FROM Gramata gr
JOIN Vertejums vrt ON isbn = vrt.ISBN;
RETURN rate;
END$$

