INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789934033513', 17, '1Q84 Trešā grāmata', 'Beigu beigās viņa nenospieda gaili. Pašā pēdējā brīdī atlaida labās rokas rādītājpirkstu, izņēma stobru no mutes. Tad dziļi ievilka elpu kā cilvēks, kuram kaut kā izdevies iznirt no dzīlēm... Ja Tengo tā arī neparādīsies, Aomame domāja, tad es līdz pat galam palikšu šajā mīklainajā 1Q84.gada pasaulē. Gatavošu ēdienu, trenēšos, pārbaudīšu, kas jauns ziņās, pāršķirstīšu Prustu, gaidot, kad parkā parādīsies Tengo. Gaidīšana kļūst par manas dzīves vadmotīvu. Triloģija 1Q84 ir apliecinājums Haruki Murakami lieliskajam rakstnieka talantam. Mūsdienu Japāna, pateicoties Murakami, šajos romānos kļuvusi par mītisku vietu, kur iespējams pilnīgi viss. Murakami spēlēšanās ar sava romāna varoņu likteņiem lasītājus savaldzina un ievilina aizvien dziļāk jocīgajās pasaulēs, kas atklājas kārtu pa kārtai. Spīd divi mēneši, un pēc samaksas ir atnācis NHK abonentmaksas iekasētājs... No japāņu valodas tulkojusi Ingūna Beķere. Arņa Kilbloka vāka dizains.', 'Romāni', 440, , '2013', 'Latviešu', 'cietie vāki', 14.02, 0);
INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789934120053', 15, '(Divas) puses. Pēc grāmatas...', 'Latviešu karavīru dienasgrāmatu krājumam (Divas)puses. Latviešu kara stāsti līdz ar tā nākšanu klajā 2011. gadā vēl nav iespējams pielikt punktu. Grāmata sāka dzīvot savu dzīvi un veidot jaunus, jau pēckara un mūslaiku stāstus par vairāku dienasgrāmatu rakstītājiem un viņu tuviniekiem. Kopš Otrā pasaules kara beigām drīz būs aizritējuši 70 gadu. Latvija ir atguvusi valstisko neatkarību. Tomēr kara cirstās rētas ir palikušas. Šis stāsts pēc grāmatas ir par mūsu tēviem un vectēviem, kurus komunistiskais un nacistiskais režīms nostādīja citu pret citu un atņēm viņiem viņu Latviju. Mākslinieks Māris Garjānis.', 'Biogrāfijas', 22, , '2012', 'Latviešu', 'mīkstie vaki', 1.21, 25);
INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789934120893', 17, '1Q84 Pirmā grāmata', 'Triloģija “1Q84” ir spēcīgākais Haruki Murakami darbs. Realitāte tajā saplūst ar sirreālo, Tokijas debesīs spīd divi mēneši, šur tur apkārt klīst little people – būtnes, kuru misija ir neskaidra un kuras var kļūt bīstamas vai draudzīgas, – pazūd cilvēki, daži tiek noslepkavoti, un nekas nav tā, kā izskatās. Murakami lasa visā pasaulē – gan dumpīgi pusaudži, gan veiksmīgi baņķieri, jo Murakami varoņu jūtu dzīve ir īsta un intensīva, lai gan rakstnieka radītā realitāte ir sirreāla un brīžiem pat mistiska. Viņi dzīvo kā dīvaini filosofi, meklējot jēgu un nozīmi katrai dienai, un arī tāpēc kļūst mīļi lasītājiem visā pasaulē. Haruki Murakami (dz. 1949) dzimis Kioto Japānā. Viņa darbi tulkoti un izdoti vairāk nekā četrdesmit valodās, viņš ir ieguvis dažādas literārās balvas. Taču vislielākā balva ir tā, ka Murakami kļuvis par kulta rakstnieku jau divām japāņu, amerikāņu un eiropiešu paaudzēm. No japāņu valodas tulkojusi Ingūna Beķere. Arņa Kilbloka vāka dizains.', 'Romāni', 464, , '2010', 'Latviešu', 'cietie vāki', 14.02, 24);
INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789984234939', 14, 'Debesu iekarotājs. Mana dzīve brīvajā kritienā', 'Ekstrema sporta lielmeistars, 4 pasaules rekordu ipasnieks Felikss Baumgartners (1969) saja gramata stasta par savu dzives celu no automehanika macekla lidz lecienam no stratosferas. Par saviem elpu aizraujosajiem lecieniem no visneiedomajamakajam vietam – no 452 metrus augstajiem Petronas Dvinu torniem Malaizija, no Jezus statujas Riodezaneiro, par lecienu Mameta ala Horvatija un daudziem citiem, kas 2012. gada 14. oktobri vainagojas ar pasaules rekordu brivaja kritiena – lecienu no stratosferas 39 kilometru augstuma, parvarot skanas barjeru. Stastijumu papildina fotografijas un citas interesantas liecibas par sportista dzivi, treniniem un iespaidigakajiem sasniegumiem. No vacu valodas tulkojusi Inga Rozentale. Artas Ozolas-Jaunarajas makslinieciskais noformejums.', 'Biografijas', 191, , '2015', 'Latviešu', 'cietie vaki', 4.50, 25);
INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789984812932', 3, 'Atbalsis. Raksti un vēstules Eiropā 1921-1946', 'Lieliskais latviesu tenors un spozais memuarists Mariss Vetra (1901–1965) sava muza ir sarakstijis tiesam daudz. Dazados preses izdevumos 40 gadu laika publiceti vairak neka tukstos rakstu. Saja krajuma pirmo reizi apkopoti musu Nacionalas operas un citu Eiropas operteatru solista un valdzinoso atminu stastu autora raksti prese, ka ari vestules latviesu kulturas darbiniekiem un draugiem, kas glabajas Latvijas muzejos, arhivos un privatos krajumos. Teksti sakartoti divos sejumos: Eiropa (1921–1946) un Kanada (1947–1965), kas atbilst ari Marisa Vetras dzives dalijumam.', 'Biografijas', 450, , '2011', 'Latviešu', 'Miksts', 15.64, 25),
('9789984824284', 5, 'Araisu ezerpils', 'Rakstu izlase un draugu atminas. Gramata atradisiet informaciju par Araisu ezerpils vesturi un tas arheologisko izpeti, ka ari citam ezeru pilim Latvija. Jana Apala un Araisu ezerpils vardi nav skirami, tie tikai papildina viens otru. Pateicoties J.Apalam, atdzima Araisu ezerpils, bet savukart pati ezerpils padarija vinu par pazistamako un popularako arheologu Latvija un tautas apzina par legendaru viru, kurs macejis no ezera dzelmes gaisma celt teikam apvito, sendienas nogrimuso senlatvju pili. Maksliniece Inara Jegere.', 'Latvijas vesture', 639, , '2012', 'Latviešu', 'Ciets', 12.79, 25),
('9789984847894', 1, '1991 - tas garais cilvekberna gads', 'Musu kinorezisora un briniskiga rakstnieka, sava laika dokumentetaja Jana Streica gramata — loti apjomigs un saturiski augstu vertejams darbs ne tikai par Latvijai un ipasi Latgalei tik svarigo filmu, bet ari par Latvijas vesture smagu un nozimigu laiku — 1990.-1992. gadu, kas skaudri un godigi atspogulojas Jana Streica ta laika dienasgramatas un sarakste ar rakstnieku Jani Klidzeju.', 'Romani', 670, , '2008', 'Latviešu', 'Ciets', 10.99, 25);
INSERT INTO `Gramata` (`ISBN`, `ID_Autors`, `Nosaukums`, `Apraksts`, `Zanrs`, `Lpp`, `Bilde`, `Gads`, `Valoda`, `Vaka_tips`, `Cena`, `Skaits`) VALUES
('9789984869452', 4, 'Aizliegta ticiba', 'Ricards Smolijs ir pasaule zinama autoritate misticisma un ezoterisko zinasanu jautajumos. Izglitojies klasiskaja literatura un filozofija Harvarda universitate un Oksfordas Universitate, vins ir vadijis vairakus religiska satura zurnalus, lasijis plasi apmekletas lekcijas un sarakstijis piecas gramatas.', 'Religija', 453, , '2010', 'Latviešu', 'Miksts', 3.62, 25);

